// Home.js (inside components directory)
import React from 'react';
import HeroImage from '../assets/group.jpg'; // Example path to hero image
import WinnersImage from '../assets/winners.jpg'; // Example path to winners image

const Home = () => {
    return (
        <div className="text-center relative">
            {/* Hero Banner Section */}
            <section className="mb-8">
                <div className="relative">
                    <img src={HeroImage} alt="Hero Banner" className="rounded-lg shadow-lg" style={{ width: '100%', height: 'auto' }} />
                    <div className="absolute top-1/4 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-white text-center">
                        <h1 className="text-4xl font-bold mb-4">Welcome to the Tailwind CSS App!</h1>

                    </div>
                </div>
            </section>

            {/* Winners Section */}
            <section>
                <h2 className="text-2xl font-semibold mt-8">Winners from Last Year</h2>
                <img src={WinnersImage} alt="Winners from Last Year" className="mt-4 rounded-lg shadow-lg" />
                <p className="mt-4 text-lg">
                    Displaying the winners from last year who achieved great success using our app.
                </p>
            </section>
        </div>
    );
};

export default Home;
